import React, { Component } from "react";
import { Button } from "reactstrap";
import "../styles/stylesheet.css";
import "../styles/Article.css";
import Navbar from "./Navbar.js";
import Footer from "./Footer.js";
import axios from "axios";
import Card from "./Card";
import Sak from "./Sak";
import {
  Container,
  ButtonDropdown,
  DropdownMenu,
  DropdownItem,
  DropdownToggle
} from "reactstrap";

export default class ArticleEdit extends Component {
  constructor(props) {
    super(props);

    this.state = {
      overskrift: "",
      innhold: "",
      bilde: "",
      kategori_id: "",
      viktighet: "",
      showInputForm: false,
      dropdownOpen: false,
      dropdownOpenImportancy: false,
      valueCategory: "Kategori",
      dropdownOpenImportancy: false,
      valueImportancy: "Viktighet (Høy: 1 Lav: 2)"
    };

    this.toggleForm = this.toggleForm.bind(this);
    this.toggle = this.toggle.bind(this);
    this.select = this.select.bind(this);
    this.toggleImportancy = this.toggleImportancy.bind(this);
    this.selectImportancy = this.selectImportancy.bind(this);
  }

  deleteHandler = e => {
    e.preventDefault();
    console.log("funker");
    console.log(this.state);
    axios
      .delete("http://localhost:8000/sak/" + this.props.match.params.id)
      .then(response => {
        console.log(response);
      })
      .catch(error => {
        console.log(error);
      });
    window.location.hash = "/sak";
  };

  render() {
    const { overskrift, innhold, bilde, kategori_id, viktighet } = this.state;
    return (
      <div>
        <Button className="bg-warning" onClick={this.deleteHandler}>
          Slett sak
        </Button>
      </div>
    );
  }
}
